datastream = ""


def find_start_of_packet(input):
    for marker in range(len(input)):
        if marker + 4 > len(input):
            break

        buffer = []
        for pointer in range(14):
            if buffer.__contains__(input[pointer + marker]):
                break

            buffer.append(input[pointer + marker])

        if len(buffer) == 14:
            print(buffer, marker + pointer + 1)
            return marker + pointer + 1


